import React from 'react';
import { getCookie } from './helpers/sessionCookie';

const Toaster = React.lazy(() => import('./views/notifications/toaster/Toaster'));
const Tables = React.lazy(() => import('./views/base/tables/Tables'));

const Breadcrumbs = React.lazy(() => import('./views/base/breadcrumbs/Breadcrumbs'));
const Cards = React.lazy(() => import('./views/base/cards/Cards'));
// const Carousels = React.lazy(() => import('./views/base/carousels/Carousels'));
const Collapses = React.lazy(() => import('./views/base/collapses/Collapses'));
const BasicForms = React.lazy(() => import('./views/base/forms/BasicForms'));

const Jumbotrons = React.lazy(() => import('./views/base/jumbotrons/Jumbotrons'));
const ListGroups = React.lazy(() => import('./views/base/list-groups/ListGroups'));
const Navbars = React.lazy(() => import('./views/base/navbars/Navbars'));
const Navs = React.lazy(() => import('./views/base/navs/Navs'));
const Paginations = React.lazy(() => import('./views/base/paginations/Pagnations'));
const Popovers = React.lazy(() => import('./views/base/popovers/Popovers'));
const ProgressBar = React.lazy(() => import('./views/base/progress-bar/ProgressBar'));
const Switches = React.lazy(() => import('./views/base/switches/Switches'));

const Tabs = React.lazy(() => import('./views/base/tabs/Tabs'));
const Tooltips = React.lazy(() => import('./views/base/tooltips/Tooltips'));
const BrandButtons = React.lazy(() => import('./views/buttons/brand-buttons/BrandButtons'));
const ButtonDropdowns = React.lazy(() => import('./views/buttons/button-dropdowns/ButtonDropdowns'));
const ButtonGroups = React.lazy(() => import('./views/buttons/button-groups/ButtonGroups'));
const Buttons = React.lazy(() => import('./views/buttons/buttons/Buttons'));
const Charts = React.lazy(() => import('./views/charts/Charts'));
const Dashboard = React.lazy(() => import('./views/dashboard/Dashboard'));
const CoreUIIcons = React.lazy(() => import('./views/icons/coreui-icons/CoreUIIcons'));
const Flags = React.lazy(() => import('./views/icons/flags/Flags'));
const Brands = React.lazy(() => import('./views/icons/brands/Brands'));
const Alerts = React.lazy(() => import('./views/notifications/alerts/Alerts'));
const Badges = React.lazy(() => import('./views/notifications/badges/Badges'));
const Modals = React.lazy(() => import('./views/notifications/modals/Modals'));
const Colors = React.lazy(() => import('./views/theme/colors/Colors'));
const Typography = React.lazy(() => import('./views/theme/typography/Typography'));
const Widgets = React.lazy(() => import('./views/widgets/Widgets'));
const Users = React.lazy(() => import('./views/users/Users'));
const User = React.lazy(() => import('./views/users/User'));
const UserSettings = React.lazy(() => import('./views/pages/user/settings'));
const ClientSettings = React.lazy(() => import('./views/pages/client/settings'));

// Wind
const Overview = React.lazy(() => import('./views/pages/wind/overview/overview'));
const MonitorAlerts = React.lazy(() => import('./views/pages/wind/overview/alerts'));
const AIAnalyticsEnergyGeneration = React.lazy(() => import('./views/pages/wind/ai-analytics/energy-generation'));
const AIAnalyticsFaultAnalysis = React.lazy(() => import('./views/pages/wind/ai-analytics/fault-analysis'));
const Budget = React.lazy(() => import('./views/pages/wind/budget/budget'));
const PowerCurveSummary = React.lazy(() => import('./views/pages/wind/power-curve/summary'));
const PowerCurveAnalysis = React.lazy(() => import('./views/pages/wind/power-curve/analysis'));
const PowerCurveBenchmark = React.lazy(() => import('./views/pages/wind/power-curve/benchmark'));
const AvailabilityAndLosses = React.lazy(() => import('./views/pages/wind/availability-and-losses/availability-and-losses'));
const Performance = React.lazy(() => import('./views/pages/wind/performance/performance'));
const Diagnostics = React.lazy(() => import('./views/pages/wind/diagnostics/diagnostics'));
const ClimateSummary = React.lazy(() => import('./views/pages/wind/climate/summary'));
const ClimateTrends = React.lazy(() => import('./views/pages/wind/climate/trends'));
const ClimateForecast = React.lazy(() => import('./views/pages/wind/climate/forecast'));
const DataAvailability = React.lazy(() => import('./views/pages/wind/data-availability/data-availability'));
const Alarms = React.lazy(() => import('./views/pages/wind/alarms/alarms'));
const Curtailments = React.lazy(() => import('./views/pages/wind/curtailments/curtailments'));
const Maintenance = React.lazy(() => import('./views/pages/wind/maintenance/maintenance'));

// Solar
const SolarOverview = React.lazy(() => import('./views/pages/solar/overview/overview'));
const SolarPerformance = React.lazy(() => import('./views/pages/solar/performance/performance'));
const SolarClimateTrends = React.lazy(() => import('./views/pages/solar/climate/trends'));
const SolarClimateForecast = React.lazy(() => import('./views/pages/solar/climate/forecast'));


const StatusTenMinAverage = React.lazy(() => import('./views/pages/status/ten-min-average'));
const ReportsSettings = React.lazy(() => import('./views/pages/reports/settings'));
const ReportsGenerate = React.lazy(() => import('./views/pages/reports/generate'));
// const LightningReport = React.lazy(() => import('./views/pages/weather-forecast/weather-forecast'));

const SolarBattery = React.lazy(() => import('./views/pages/mocks/solar-battery'));

let routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Monitor', component: Dashboard },
  { path: '/theme', name: 'Theme', component: Colors, exact: true },
  { path: '/theme/colors', name: 'Colors', component: Colors },
  { path: '/theme/typography', name: 'Typography', component: Typography },
  { path: '/base', name: 'Base', component: Cards, exact: true },
  { path: '/base/breadcrumbs', name: 'Breadcrumbs', component: Breadcrumbs },
  { path: '/base/cards', name: 'Cards', component: Cards },
  // { path: '/base/carousels', name: 'Carousel', component: Carousels },
  { path: '/base/collapses', name: 'Collapse', component: Collapses },
  { path: '/base/forms', name: 'Forms', component: BasicForms },
  { path: '/base/jumbotrons', name: 'Jumbotrons', component: Jumbotrons },
  { path: '/base/list-groups', name: 'List Groups', component: ListGroups },
  { path: '/base/navbars', name: 'Navbars', component: Navbars },
  { path: '/base/navs', name: 'Navs', component: Navs },
  { path: '/base/paginations', name: 'Paginations', component: Paginations },
  { path: '/base/popovers', name: 'Popovers', component: Popovers },
  { path: '/base/progress-bar', name: 'Progress Bar', component: ProgressBar },
  { path: '/base/switches', name: 'Switches', component: Switches },
  { path: '/base/tables', name: 'Tables', component: Tables },
  { path: '/base/tabs', name: 'Tabs', component: Tabs },
  { path: '/base/tooltips', name: 'Tooltips', component: Tooltips },
  { path: '/buttons', name: 'Buttons', component: Buttons, exact: true },
  { path: '/buttons/buttons', name: 'Buttons', component: Buttons },
  { path: '/buttons/button-dropdowns', name: 'Dropdowns', component: ButtonDropdowns },
  { path: '/buttons/button-groups', name: 'Button Groups', component: ButtonGroups },
  { path: '/buttons/brand-buttons', name: 'Brand Buttons', component: BrandButtons },
  { path: '/charts', name: 'Charts', component: Charts },
  { path: '/icons', exact: true, name: 'Icons', component: CoreUIIcons },
  { path: '/icons/coreui-icons', name: 'CoreUI Icons', component: CoreUIIcons },
  { path: '/icons/flags', name: 'Flags', component: Flags },
  { path: '/icons/brands', name: 'Brands', component: Brands },
  { path: '/notifications', name: 'Notifications', component: Alerts, exact: true },
  { path: '/notifications/alerts', name: 'Alerts', component: Alerts },
  { path: '/notifications/badges', name: 'Badges', component: Badges },
  { path: '/notifications/modals', name: 'Modals', component: Modals },
  { path: '/notifications/toaster', name: 'Toaster', component: Toaster },
  { path: '/widgets', name: 'Widgets', component: Widgets },
  { path: '/users', exact: true,  name: 'Users', component: Users },
  { path: '/users/:id', exact: true, name: 'User Details', component: User },
  { path: '/user/settings', exact: true, name: 'User Settings', component: UserSettings },
  { path: '/client/settings', exact: true, name: 'Client Settings', component: ClientSettings },
]
if (getCookie('parkType') == 'solar') {
  routes = [...routes, 
    { path: '/modules/overview', exact: true, name: 'Overview', component: SolarOverview },
    { path: '/modules/climate/trends', exact: true, name: 'Climate - Trends', component: SolarClimateTrends },
    { path: '/modules/climate/forecast', exact: true, name: 'Climate - Forecast', component: SolarClimateForecast },
    { path: '/modules/performance', exact: true, name: 'Performance', component: SolarPerformance },
  ]
} else {
    // Wind
    routes = [...routes, 
      { path: '/modules/overview', exact: true, name: 'Overview', component: Overview },
      { path: '/modules/overview/alerts', exact: true, name: 'Alerts', component: MonitorAlerts },
      { path: '/modules/ai-analytics/energy-generation', exact: true, name: 'AI Analytics - Energy Generation', component: AIAnalyticsEnergyGeneration },
      { path: '/modules/ai-analytics/fault-analysis', exact: true, name: 'AI Analytics - Fault Analysis', component: AIAnalyticsFaultAnalysis },
      { path: '/modules/budget', exact: true, name: 'Budget', component: Budget },
      { path: '/modules/power-curve/summary', exact: true, name: 'Power Curve - Summary', component: PowerCurveSummary },
      { path: '/modules/power-curve/analysis', exact: true, name: 'Power Curve - Analysis', component: PowerCurveAnalysis },
      { path: '/modules/power-curve/benchmark', exact: true, name: 'Power Curve - Benchmark', component: PowerCurveBenchmark },
      { path: '/modules/availability-and-losses', exact: true, name: 'Availability and Losses', component: AvailabilityAndLosses },
      { path: '/modules/performance', exact: true, name: 'Performance', component: Performance },
      { path: '/modules/diagnostics', exact: true, name: 'Diagnostics', component: Diagnostics },
      { path: '/modules/data-availability', exact: true, name: 'Data Availability', component: DataAvailability },
      { path: '/modules/climate/summary', exact: true, name: 'Climate - Summary', component: ClimateSummary },
      { path: '/modules/climate/trends', exact: true, name: 'Climate - Trends', component: ClimateTrends },
      { path: '/modules/climate/forecast', exact: true, name: 'Climate - Forecast', component: ClimateForecast },
      { path: '/modules/alarms', exact: true, name: 'Alarms', component: Alarms },
      { path: '/modules/curtailments', exact: true, name: 'Curtailments', component: Curtailments },
      { path: '/modules/maintenance', exact: true, name: 'Maintenance', component: Maintenance },
    ]
  }
  routes = [...routes, 
    { path: '/modules/status/ten-min-average', exact: true, name: 'Status - 10 Min Average', component: StatusTenMinAverage },
    { path: '/modules/reports/settings', exact: true, name: 'Reports - Settings', component: ReportsSettings },
    { path: '/modules/reports/generate', exact: true, name: 'Reports - Generate', component: ReportsGenerate },
    { path: '/modules/solar-battery', exact: true, name: 'Solar + Battery', component: SolarBattery },
  ]
  // Wind
  // { path: '/modules/wind/overview', exact: true, name: 'Overview', component: Overview },
  // { path: '/modules/wind/overview/alerts', exact: true, name: 'Alerts', component: MonitorAlerts },
  // { path: '/modules/wind/ai-analytics/energy-generation', exact: true, name: 'AI Analytics - Energy Generation', component: AIAnalyticsEnergyGeneration },
  // { path: '/modules/wind/ai-analytics/fault-analysis', exact: true, name: 'AI Analytics - Fault Analysis', component: AIAnalyticsFaultAnalysis },
  // { path: '/modules/wind/budget', exact: true, name: 'Budget', component: Budget },
  // { path: '/modules/wind/power-curve/summary', exact: true, name: 'Power Curve - Summary', component: PowerCurveSummary },
  // { path: '/modules/wind/power-curve/analysis', exact: true, name: 'Power Curve - Analysis', component: PowerCurveAnalysis },
  // { path: '/modules/wind/power-curve/benchmark', exact: true, name: 'Power Curve - Benchmark', component: PowerCurveBenchmark },
  // { path: '/modules/wind/availability-and-losses', exact: true, name: 'Availability and Losses', component: AvailabilityAndLosses },
  // { path: '/modules/wind/performance', exact: true, name: 'Performance', component: Performance },
  // { path: '/modules/wind/diagnostics', exact: true, name: 'Diagnostics', component: Diagnostics },
  // { path: '/modules/wind/data-availability', exact: true, name: 'Data Availability', component: DataAvailability },
  // { path: '/modules/wind/climate/summary', exact: true, name: 'Climate - Summary', component: ClimateSummary },
  // { path: '/modules/wind/climate/trends', exact: true, name: 'Climate - Trends', component: ClimateTrends },
  // { path: '/modules/wind/climate/forecast', exact: true, name: 'Climate - Forecast', component: ClimateForecast },
  // { path: '/modules/wind/alarms', exact: true, name: 'Alarms', component: Alarms },
  // { path: '/modules/wind/curtailments', exact: true, name: 'Curtailments', component: Curtailments },
  // { path: '/modules/wind/maintenance', exact: true, name: 'Maintenance', component: Maintenance },
  // Solar
  // { path: '/modules/solar/overview', exact: true, name: 'Overview', component: SolarOverview },
  // { path: '/modules/solar/climate/trends', exact: true, name: 'Climate - Trends', component: SolarClimateTrends },
  // { path: '/modules/solar/climate/forecast', exact: true, name: 'Climate - Forecast', component: SolarClimateForecast },
  // { path: '/modules/solar/performance', exact: true, name: 'Performance', component: SolarPerformance },

  // { path: '/modules/reports/settings', exact: true, name: 'Reports - Settings', component: ReportsSettings },
  // { path: '/modules/reports/generate', exact: true, name: 'Reports - Generate', component: ReportsGenerate },

  // { path: '/modules/solar-battery', exact: true, name: 'Solar + Battery', component: SolarBattery },
// ];

const functionalities = JSON.parse(getCookie('functionalities'));
routes.filter(r => functionalities.indexOf(level2.to) > -1 )

export default routes;
